export default function start_rating({ maxRating = 5 }) {
  //default prop
  const textStyle = {
    lineHeight: 1,
    margin: 0,
    fontSize: "18px",
  };
  return (
    <div>
      <div>
        {Array.from({ length: maxRating }, (_, i) => (
          <Star key={1} />
        ))}
        <p>{10}</p>
      </div>
    </div>
  );
}
function Star() {
  return <span role="button"></span>;
}
